import React, { Component } from 'react';
import { Control, LocalForm, Form, Errors } from 'react-redux-form';
import { Row, Col, Label, Button } from 'reactstrap';

class CreateAccount extends Component {

    constructor(props){
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleSubmit(values){
        alert(JSON.stringify(values));
    }

    render(){
        return(
            <LocalForm onSubmit={(values) => this.handleSubmit(values)}>
                <Row className="form-group">
                <Label htmlFor="accounttype">Account Type:</Label>
                <Col>
                    <Control.select className="form-control">
                        <option>Checking</option>
                        <option>Savings</option>
                        <option>Personal Checking</option>
                        <option>Certificate Of Deposit</option>
                        <option>DBA Checking</option>
                    </Control.select>
                </Col>
                </Row>
                <Row className="form-group">
                <Label htmlFor="balance">Opening Balance</Label>
                <Col>
                    <Control.text className="form-control" placeholder="Opening Balance" />
                </Col>
                </Row>
                <Row className="form-group">
                    <Col>
                        <Button type="submit" color="primary">
                            Create Account
                        </Button>
                    </Col>
                </Row>
            </LocalForm>
        );
    }
}

export default CreateAccount
